import React from 'react';
import styles from './TeamLineupOverlay.module.css';

const roleSvgs = {
  TOP: (
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none"><circle cx="12" cy="12" r="10" stroke="#00eaff" strokeWidth="2"/><path d="M12 6v6l4 2" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  JNG: (
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none"><rect x="4" y="4" width="16" height="16" rx="8" stroke="#00eaff" strokeWidth="2"/><path d="M12 8v4l3 3" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  MID: (
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none"><ellipse cx="12" cy="12" rx="10" ry="6" stroke="#00eaff" strokeWidth="2"/><path d="M12 6v12" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  ADC: (
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none"><rect x="4" y="8" width="16" height="8" rx="4" stroke="#00eaff" strokeWidth="2"/><path d="M8 12h8" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  SUP: (
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none"><circle cx="12" cy="12" r="10" stroke="#00eaff" strokeWidth="2"/><path d="M8 16c0-2.21 1.79-4 4-4s4 1.79 4 4" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
};

const TeamLineupOverlay = () => {
  // Sample data - can be made dynamic later
  const teamData = {
    championship: "WORLD CHAMPIONSHIP",
    location: "LONDON",
    stage: "WORLDS FINAL",
    teamName: "T1",
    region: "LCK#4",
    logo: "https://via.placeholder.com/120x120/ffffff/000000?text=T1",
    players: [
      {
        name: "Zeus",
        role: "TOP",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Zeus"
      },
      {
        name: "Oner", 
        role: "JNG",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Oner"
      },
      {
        name: "Faker",
        role: "MID", 
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Faker"
      },
      {
        name: "Gumayusi",
        role: "ADC",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Gumayusi"
      },
      {
        name: "Keria",
        role: "SUP",
        image: "https://via.placeholder.com/200x250/4a90e2/ffffff?text=Keria"
      }
    ],
    matchHistory: [
      { stage: "SWISS STAGE", round: "R1", opponent: "TES", result: "W" },
      { stage: "SWISS STAGE", round: "R2", opponent: "PNG", result: "W" },
      { stage: "SWISS STAGE", round: "R3", opponent: "BLG", result: "W" },
      { stage: "SWISS STAGE", round: "R4", opponent: "G2", result: "W", score: "2:0" },
      { stage: "QUARTERFINALS", round: "", opponent: "TES", result: "W", score: "3:0" },
      { stage: "SEMIFINALS", round: "", opponent: "GEN", result: "W", score: "3:1" }
    ]
  };

  return (
    <div className={styles.overlay}>
      {/* Background and frame */}
      <div className={styles.background}>
        {/* Header section */}
        <div className={styles.header}>
          <div className={styles.championship}>
            <div className={styles.championshipText}>{teamData.championship}</div>
            <div className={styles.locationText}>{teamData.location}</div>
            <div className={styles.stageText}>{teamData.stage}</div>
          </div>

          <div className={styles.teamInfo}>
            <div className={styles.teamLogo}>
              <img src={teamData.logo} alt={teamData.teamName} />
            </div>
            <div className={styles.teamName}>{teamData.teamName}</div>
            <div className={styles.teamRegion}>{teamData.region}</div>
          </div>

          <div className={styles.leagueLogo}>
            <div className={styles.leagueText}>LEAGUE<span className={styles.ofText}>OF</span></div>
            <div className={styles.legendsText}>LEGENDS</div>
          </div>
        </div>

        {/* Player lineup section */}
        <div className={styles.players}>
          {teamData.players.map((player, index) => (
            <div key={index} className={styles.playerCard}>
              <div className={styles.playerRoleIcon}>
                {roleSvgs[player.role]}
              </div>
              <div className={styles.playerName}>{player.name}</div>
              <div className={styles.playerImage}>
                <img src={player.image} alt={player.name} />
              </div>
            </div>
          ))}
        </div>

        {/* Tournament progression section */}
        <div className={styles.tournament}>
          {teamData.matchHistory.map((match, index) => (
            <div key={index} className={styles.matchInfo}>
              <div className={styles.stageName}>{match.stage}</div>
              <div className={styles.matchDetails}>
                {match.round && <span className={styles.round}>{match.round}</span>}
                <span className={styles.vsText}>VS {match.opponent}</span>
                {match.score && <span className={styles.score}>{match.score}</span>}
              </div>
            </div>
          ))}
        </div>

        {/* Decorative frame elements */}
        <div className={styles.frameTopLeft}></div>
        <div className={styles.frameTopRight}></div>
        <div className={styles.frameBottomLeft}></div>
        <div className={styles.frameBottomRight}></div>
        <div className={styles.gridLines}></div>
      </div>
    </div>
  );
};

export default TeamLineupOverlay;
